📹 @namib_naude: Please watch this one right through..... Yesterday morning we saw this pup with a huge bundle of gillnet around his neck. It was also through his mouth and would have blocked him from eating too. While we were busy Antoine spotted another one behind us. The second one was a pup with a huge hook in his jaw. We actually missed him a few days ago and have been searching hard for him again. We were forced to stay away from the beach for 4 days due to some crazy winds. Yesterday and today we caught a total of 21 seals! It sounds amazing but truth is we have no idea how serious this problem of ocean pollution is right now. It's time for serious change.
